// UpdateNewValues updates the mutable fields using the new values that
// were set on create. Using this option is equivalent to using:
//
//	client.DataExport.Create().
//		OnConflict(
//			sql.ResolveWithNewValues(),
//		).
//		Exec(ctx)
func (u *DataExportUpsertBulk) UpdateNewValues() *DataExportUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWithNewValues())
	u.create.conflict = append(u.create.conflict, sql.ResolveWith(func(s *sql.UpdateSet) {
		for _, b := range u.create.builders {
			if _, exists := b.mutation.CreatedAt(); exists {
				s.SetIgnore(dataexport.FieldCreatedAt)
			}
			if _, exists := b.mutation.StoreID(); exists {
				s.SetIgnore(dataexport.FieldStoreID)
			}
			if _, exists := b.mutation.GetType(); exists {
				s.SetIgnore(dataexport.FieldType)
			}
			if _, exists := b.mutation.OperatorType(); exists {
				s.SetIgnore(dataexport.FieldOperatorType)
			}
			if _, exists := b.mutation.OperatorID(); exists {
				s.SetIgnore(dataexport.FieldOperatorID)
			}
			if _, exists := b.mutation.OperatorName(); exists {
				s.SetIgnore(dataexport.FieldOperatorName)
			}
			if _, exists := b.mutation.FileName(); exists {
				s.SetIgnore(dataexport.FieldFileName)
			}
		}
	}))
	return u
}

